import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import WelcomeScreen from './screens/WelcomeScreen';

export default function App() {
  return (
    <WelcomeScreen
      x={5} y={10}
      person={{
        name: "Do Quoc Thuong",
        age: 18,
        email: "thuongdq@gmail.com"
      }}
    />
  );
}
